import '../css/App.css';

const Backdrop = ({ gameList, currentSummonerName, searchInput, version }) => {
  const mostPlayedChamp = "Illaoi"; // Declare the variable outside the JSX

  return (
    <div className="champ-background-image" 
    style={{ backgroundImage: `url('https://static.bigbrain.gg/assets/lol/riot_static/${version}/img/splash/${mostPlayedChamp}_1.jpg')` }}>

    </div>
  );
}

